    public function getInterconsultas(): void
    {
        try {
            if (!isset($_GET["esp"])) {
                throw new \RuntimeException("No se encontr el parametro {esp}.");
            }

            $espCod = $_GET["esp"];
            $esps = array_filter($this->interconsultas, fn ($in) => ($in["especialidad_cod"] == $espCod));
            
            Response::json(array_values($esps));
        } catch (\Throwable $e) {
            Response::jsonError($e->getMessage());
        }
    }

    public function getInterconsultasFull(): void
    {
        $inte = array_map( 
            fn($el) => array_merge($el, array("nombre" => $this->especialidades[$el["especialidad_cod"]])),
            $this->interconsultas
        );

        Response::json($inte);
    }

    public function getInterconsultasPendientes()
    {
        try {
            if (!isset($_GET["esp"])) {
                throw new \RuntimeException("No se encontr el parametro {esp}.");
            }
            $espCod = strtoupper($_GET["esp"]);
            
            if (! in_array($espCod, array_keys($this->especialidades))) {
                throw new \RuntimeException("Especialidad No encontrada. {$espCod}");
            }

            $esps = array_filter(
                $this->interconsultas, 
                fn ($in) => ($in["especialidad_cod"] == $espCod) && ($in["itc"]["estado"] == "P")
            );
            
            Response::json(array_values($esps));
        } catch (\Throwable $e) {
            Response::jsonError($e->getMessage());
        }
    }
